import { FC } from "react";

interface ButtonsProps {
  buttons: [
    {
      id: string;
      name: string;
    }
  ];
}

const Buttons: FC<ButtonsProps> = ({ buttons }: ButtonsProps) => {
  return <div>Buttons</div>;
};

export default Buttons;
